const CURRENCIES=['USD','EUR','GBP','RON','AUD','CAD','CHF','CZK','DKK','HUF','JPY','NOK','PLN','SEK','TRY','RUB','CNY','BGN','HRK','BRL','HKD','IDR','KRW','MXN','MYR','NZD','PHP','SGD','ZAR','MDL','AED','EGP','INR','RSD','UAH','TWD','ILS','QAR','SAR','ARS','CLP','BOB','COP','DOP','PYG','PEN','UYU','NGN','NAD','TND','DZD','KES','MAD','PKR','THB','BYN']
const popoverTriggerList=[].slice.call(document.querySelectorAll('[data-toggle="popover"]'))
const popoverList=popoverTriggerList.map((popoverTriggerEl)=>new coreui.Popover(popoverTriggerEl))
const pricingSection=document.getElementById('pricing-new')
if(pricingSection){const productCode=pricingSection.dataset.productCode
const priceFree=document.getElementById('current-price-free')
const pricePro=document.getElementById('current-price-pro')
const paymentCurrency=document.getElementById('payment-currency')
const buyFree=document.getElementById('buy-free')
const buyPro=document.getElementById('buy-pro')
let free
let pro
const userLang=()=>navigator.language||navigator.userLanguage
const getPrice=(product,currency,quantity)=>{const price=product['Prices']['Regular'].filter(price=>price['Currency']===currency).filter(price=>quantity>=price['MinQuantity']).filter(price=>quantity<=price['MaxQuantity'])
return price[0]['Amount']}
const getDefaultPrice=(product,quantity)=>{const currency="USD"
const price=product[0]['Prices']['Regular'].filter(price=>price['Currency']===currency).filter(price=>quantity>=price['MinQuantity']).filter(price=>quantity<=price['MaxQuantity'])
return price[0]['Amount']}
const getPricingOption=(pricingOptionsGroups,pricingOptionGroupCode,pricingOptionCode,currency)=>{const selectPicingOptionsGroup=pricingOptionsGroups.filter(element=>element['Code']===pricingOptionGroupCode)[0]
const selectPicingOption=selectPicingOptionsGroup['Options'].filter(element=>element['Code']===pricingOptionCode)[0]
const amounts=selectPicingOption['PriceImpact']['Amounts'][currency]['Amount']
return amounts}
const sumPrices=(allProducts,products,currency,quantity=1)=>{let sum=0
products.forEach(product=>{sum+=parseInt(getPrice(allProducts.filter(element=>element['ProductCode']===`${product}-pro`)[0],currency,quantity))})
return sum}
const formatCurrency=(amount,currency)=>{return new Intl.NumberFormat(userLang,{style:'currency',currency,minimumFractionDigits:0}).format(amount);}
const getQueryParams=(params,url)=>{let href=url;let reg=new RegExp('[?&]'+params+'=([^&#]*)','i')
let queryString=reg.exec(href)
return queryString?queryString[1]:null}
const pricing=(data)=>{const code=data.countryCode
const currency=CURRENCIES.includes(data.currency)?data.currency:"USD"
buyPro.href=buyPro.href.indexOf('QTY=')!==-1?`${buyPro.href}&LANG=${userLang().split('-')[0]}&CURRENCY=${currency}`:`${buyPro.href}&language=${userLang().split('-')[0]}&currency=${currency}`
fetch('/data/pricing.json').then(res=>res.json()).then(data=>{const products=data.Products
const pricingOptionsGroups=data.PricingOptionsGroups
pro=products.filter(element=>element['ProductCode']==='coreui-icons-pro')[0]
freeBasePrice=formatCurrency(0,currency)
proBasePrice=formatCurrency(getPrice(pro,currency,4),currency)
priceFree.innerHTML=freeBasePrice
pricePro.innerHTML=proBasePrice
paymentCurrency.innerHTML=currency}).catch(err=>{throw err})
fetch('/data/payment-methods.json').then(res=>res.json()).then(data=>{const paymentMethodsContainer=document.getElementById('payment-methods')
const paymentMethods=data.find(element=>element.countryCode===code).methods
paymentMethods.forEach(method=>{const img=document.createElement('img')
img.src=`/images/payment_methods/${method.img}`
img.alt=method.alt
img.style.outline='2px solid #fff'
img.style.outlineOffset='-2px'
paymentMethodsContainer.appendChild(img)})}).catch(err=>{throw err})}
fetch('https://pro.ip-api.com/json/?key=EEKS6bLi6D91G1p&fields=status,message,country,countryCode,timezone,currency,query').then((res)=>{return res.json()}).then(data=>{pricing(data)}).catch(err=>{fetch('https://api.coreui.io/geo/').then((res)=>{return res.json()}).then(data=>{pricing(data)}).catch(err=>{throw err})})}
